import React, { useState } from 'react';
import { supabase } from '../config/supabase';
import { useNavigate } from 'react-router-dom';
import { Toast } from './common/Toast';

export function DrillDashboard() {
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');
  const [showToast, setShowToast] = useState(false);
  const [toastType, setToastType] = useState('success');
  const [newDrill, setNewDrill] = useState({
    name: '',
    purpose: '',
    plane: '',
    muscles: '',
    joint_actions: '',
    nervous_system: '',
    psych_components: '',
    tendons_loaded: '',
    influences: '',
    execution_needs: '',
    regression: '',
    notes: '',
    instructions: '',
    video_url: ''
  });
  const [textBlock, setTextBlock] = useState('');
  const navigate = useNavigate();

  const showErrorToast = (message) => {
    setError(message);
    setSuccessMessage(message);
    setToastType('error');
    setShowToast(true);
  };

  const showSuccessToast = (message) => {
    setSuccessMessage(message);
    setToastType('success');
    setShowToast(true);
  };

  async function addDrill(e) {
    e.preventDefault();

    if (!newDrill.name.trim()) {
      showErrorToast('Drill name is required');
      return;
    }

    try {
      setLoading(true);
      setError(null);

      // Clean the drill data - only include non-empty fields
      const cleanDrillData = {
        name: newDrill.name.trim(),
        purpose: newDrill.purpose.trim() || null,
        plane: newDrill.plane.trim() || null,
        muscles: newDrill.muscles.trim() || null,
        joint_actions: newDrill.joint_actions.trim() || null,
        nervous_system: newDrill.nervous_system.trim() || null,
        psych_components: newDrill.psych_components.trim() || null,
        tendons_loaded: newDrill.tendons_loaded.trim() || null,
        influences: newDrill.influences.trim() || null,
        execution_needs: newDrill.execution_needs.trim() || null,
        regression: newDrill.regression.trim() || null,
        notes: newDrill.notes.trim() || null,
        instructions: newDrill.instructions.trim() || null,
        video_url: newDrill.video_url.trim() || null
      };

      // Insert the drill into the drills table
      const { data, error } = await supabase
        .from('drills')
        .insert([cleanDrillData])
        .select();

      if (error) throw error;

      // Reset form fields
      setNewDrill({
        name: '',
        purpose: '',
        plane: '',
        muscles: '',
        joint_actions: '',
        nervous_system: '',
        psych_components: '',
        tendons_loaded: '',
        influences: '',
        execution_needs: '',
        regression: '',
        notes: '',
        instructions: '',
        video_url: ''
      });
      setTextBlock('');

      // Show success message
      showSuccessToast('Drill added successfully');

      // Navigate to the drill library after a short delay
      setTimeout(() => {
        navigate('/library');
      }, 1500);
    } catch (err) {
      showErrorToast('Failed to add drill: ' + (err.message || 'Unknown error'));
      console.error('Error adding drill:', err);
    } finally {
      setLoading(false);
    }
  }

  function handleInputChange(e) {
    const { name, value } = e.target;
    setNewDrill({
      ...newDrill,
      [name]: value
    });
  }

  function parseTextBlock() {
    if (!textBlock.trim()) {
      showErrorToast('Please paste a drill block to parse');
      return;
    }

    try {
      // Simple parsing logic - can be enhanced based on actual format
      const lines = textBlock.split('\n');
      const parsedDrill = { ...newDrill };

      lines.forEach(line => {
        const [key, ...valueParts] = line.split(':');
        const value = valueParts.join(':').trim();

        if (key && value) {
          const normalizedKey = key.toLowerCase().trim().replace(/\s+/g, '_');
          if (normalizedKey in parsedDrill) {
            parsedDrill[normalizedKey] = value;
          }
        }
      });

      setNewDrill(parsedDrill);
      showSuccessToast('Drill block parsed successfully');
    } catch (err) {
      showErrorToast('Failed to parse drill block: ' + err.message);
      console.error('Error parsing drill block:', err);
    }
  }

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-6 text-orange-400">Add New Drill</h2>

      <Toast 
        message={successMessage} 
        isVisible={showToast} 
        onClose={() => setShowToast(false)} 
        type={toastType} 
      />

      <div className="mb-6">
        <h3 className="text-lg font-medium mb-2 text-blue-400">Paste Full Drill Block</h3>
        <textarea
          className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white h-40"
          value={textBlock}
          onChange={(e) => setTextBlock(e.target.value)}
          placeholder="Paste your drill block here (format: Key: Value, one per line)"
        />
        <button
          className="mt-2 bg-blue-600 hover:bg-blue-500 text-white px-4 py-2 rounded"
          onClick={parseTextBlock}
        >
          Parse Block
        </button>
      </div>

      <form onSubmit={addDrill} className="space-y-4">
        <div>
          <label className="block mb-2 text-gray-300">Name *</label>
          <input
            type="text"
            name="name"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.name}
            onChange={handleInputChange}
            required
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Purpose</label>
          <input
            type="text"
            name="purpose"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.purpose}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Plane</label>
          <input
            type="text"
            name="plane"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.plane}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Muscles</label>
          <input
            type="text"
            name="muscles"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.muscles}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Joint Actions</label>
          <input
            type="text"
            name="joint_actions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.joint_actions}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Nervous System</label>
          <input
            type="text"
            name="nervous_system"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.nervous_system}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Psych Components</label>
          <input
            type="text"
            name="psych_components"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.psych_components}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Tendons Loaded</label>
          <input
            type="text"
            name="tendons_loaded"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.tendons_loaded}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Influences</label>
          <input
            type="text"
            name="influences"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.influences}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Execution Needs</label>
          <input
            type="text"
            name="execution_needs"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.execution_needs}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Regression</label>
          <input
            type="text"
            name="regression"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.regression}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Notes</label>
          <textarea
            name="notes"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white h-24"
            value={newDrill.notes}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Instructions</label>
          <textarea
            name="instructions"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white h-32"
            value={newDrill.instructions}
            onChange={handleInputChange}
          />
        </div>

        <div>
          <label className="block mb-2 text-gray-300">Video URL</label>
          <input
            type="url"
            name="video_url"
            className="w-full p-3 bg-[#1e1e1e] border border-[#3a3a3a] rounded text-white"
            value={newDrill.video_url}
            onChange={handleInputChange}
            placeholder="https://example.com/video"
          />
        </div>

        <button
          type="submit"
          className="bg-green-600 hover:bg-green-500 text-white px-6 py-3 rounded font-medium"
          disabled={loading}
        >
          {loading ? 'Adding...' : 'Add Drill'}
        </button>
      </form>
    </div>
  );
}
